spring:  jmx:    enabled: false  datasource:    url: '@datasource.url@'    username: '@datasource.username@'    password: '@datasource.password@'  redis:    host: '@redis.host@'    port: '@redis.port@'  rabbitmq:    host: '@rabbitmq.host@'  cloud:    nacos:      server-addr: '@nacos.url@'      discovery:        username: '@nacos.username@'        password: '@nacos.password@'jwt:  secret: '@jwt.secret@'logging:  file:    path: /logs    max-history: 30